const axios = require('axios');
let userValue = '';
axios.default.baseURL = "https://vpic.nhtsa.dot.gov/api//vehicles/DecodeVin/";
const getIN = (event)=>{
    userValue = event.target.value;
    console.log(userValue);
    axios({
        url: userValue
    })
    .then(function(response){console.log(response.data)})
}
export {getIN};
